import {AUTHENTICATE} from "./types";

const authReducer = (state = {token: null}, action) => {
    switch(action.type){
        case AUTHENTICATE :
            return {
                ...state,
                token: action.payload
            }
        default:
            return state
    }
}

export default authReducer;
